CREATE TABLE Chicago_Crimes_sample (
    id INT,
    CaseNumber VARCHAR(8),
    Date VARCHAR(29),
    Block VARCHAR(29),
    IUCR VARCHAR(10),
    PrimaryType VARCHAR(50),
    Description VARCHAR(50),
    LocationDescription VARCHAR(50),
    Arrest VARCHAR(5),
    Domestic VARCHAR(5),
    Beat INT,
    District NUMERIC(4, 1),
    Ward NUMERIC(4, 1),
    CommunityArea NUMERIC(4, 1),
    FBICode VARCHAR(3),
    XCoordinate INT,
    YCoordinate INT,
    YEAR INT,
    UpdatedOn VARCHAR(50),
    Latitude INT,
    Longitude INT,
    LOCATION VARCHAR(60)
);

